script: |
  super -f text -I q13405.spq | sort > q13405.out

inputs:
  - name: q13405.spq
    data: |
      SELECT DISTINCT - + col0, - 71 * + - col1 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT ( NOT + col1 BETWEEN - - col0 AND + col1 + + col2 );
  - name: tab1

outputs:
  - name: q13405.out
    data: |
